import React from 'react'
import styled from 'styled-components'


function Pin() {
  return (
    <Wrapper>Hello Pin
    <Container>
        <img src="https://images.unsplash.com/photo-1479839672679-a46483c0e7c8?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1310&q=80" />

    </Container>

</Wrapper>
  )
}

export default Pin

const Wrapper = styled.div`
  display: flex;
`;
const Container = styled.div`
hei
`
